{ كُل نفسٍ ذَائِقةُ الْمَوْت } 

و إنّا لله وإنّا إليه راجعون . 
انتقل إلى رحمة الله تعالى العم/ هزاع بن دبيان العتيبي ،اللهمّ أبدله داراً خيراً من داره، وأهلاً خيراً من أهله، وأدخله الجنّة، وأعذه من عذاب القبر ومن عذاب النّار.
